document.addEventListener("DOMContentLoaded", function () {
    let mensajeIdEliminar = null;

    // Función para abrir el modal y guardar el ID del mensaje a eliminar
    window.eliminarMensaje = function(id) {
        mensajeIdEliminar = id;
        console.log("🟢 Mensaje seleccionado para eliminar, ID:", mensajeIdEliminar);

        let modal = document.getElementById('modalMensaje');
        if (modal) {
            modal.style.display = 'flex';
        }
    };

    // Evento para confirmar la eliminación
    let btnConfirmarEliminar = document.getElementById('btnConfirmarEliminar');
    if (btnConfirmarEliminar) {
        btnConfirmarEliminar.addEventListener('click', function() {
            if (mensajeIdEliminar !== null && !isNaN(mensajeIdEliminar)) {
                let sanitizedId = encodeURIComponent(mensajeIdEliminar);

                if (typeof baseUrl !== "undefined") {
                    let url = `${baseUrl}/eliminar-mensaje/${sanitizedId}`;
                    console.log("🟢 Redirigiendo a:", url);
                    window.location.href = url;
                } else {
                    console.error("🔴 Error: baseUrl no está definido");
                }
            } else {
                console.error("🔴 Error: ID de mensaje no válido", mensajeIdEliminar);
            }
        });
    } else {
        console.error("🔴 Error: No se encontró el botón btnConfirmarEliminar");
    }

    // Cerrar modal cuando se cancela
    let btnCancelarEliminar = document.getElementById('btnCancelarEliminar');
    if (btnCancelarEliminar) {
        btnCancelarEliminar.addEventListener('click', function() {
            // Cerrar modal sin hacer nada
            document.getElementById('modalMensaje').style.display = 'none';
            mensajeIdEliminar = null;  // Resetear el ID del mensaje
            console.log("🟡 Eliminación cancelada");
        });
    }

    // Función para eliminar todos los mensajes
    window.confirmarEliminarTodos = function() {
        let modalEliminarTodos = document.getElementById('modalEliminarTodos');
        if (modalEliminarTodos) {
            modalEliminarTodos.style.display = 'flex';
        }
    };

    let btnConfirmarEliminarTodos = document.getElementById('btnConfirmarEliminarTodos');
    if (btnConfirmarEliminarTodos) {
        btnConfirmarEliminarTodos.addEventListener('click', function() {
            document.getElementById('formEliminarMensajes').submit();
        });
    }

    let btnCancelarEliminarTodos = document.getElementById('btnCancelarEliminarTodos');
    if (btnCancelarEliminarTodos) {
        btnCancelarEliminarTodos.addEventListener('click', function() {
            document.getElementById('modalEliminarTodos').style.display = 'none';
        });
    }
});

